import React from 'react';

const Card = ({ id, name, email}) => {
	return (
		<div className="bg-light-blue dib br3 pa3 ma2 grow tc">
			<img src={`https://www.robohash.org/${props.id}?200x200`} alt="robots" />
			<div>
				<h2>{props.name}</h2>
				<p>{props.email}</p>
			</div>
		</div>
		);
}

export default Card;
